import React from 'react';
import PortfolioItem from './PortfolioItem/Portfolioitem';
import PrevItemButton from './PrevItemButton/PrevItemButton';
import NextItemButton from './NextItemButton/NextItemButton';

const PortfolioListItems = props => {
	const items = props.items.map(item => (
		<>
			<PrevItemButton />

			<PortfolioItem
				key={item.id}
				name={item.name}
				backgroundImageURL={item.backgroundImageURL}
				id={item.id}
				link={item.link}
			/>

			<NextItemButton />
		</>
	));

	return <div className="portfolio-items-list">{items}</div>;
};

export default PortfolioListItems;
